import './App.css';
import angrycat from './images/angrycat.jpg';

function App() {

  const header = <nav className='nav_bar'>
    <img src={angrycat} alt='Navbar Logo' />
    <ul>
      <li>
        <a href="/">Home</a>
      </li>
      <li>
        <a href="/contact-us">Contact</a>
      </li>
    </ul>
  </nav>

  return (
    <>
      {header}
      <h1>This is Home</h1>
    </>
  );
}

export default App;
